import React from 'react';
import {
    Container,
    BackgroundImage,
    Overlay,
    TextContainer,
    Title,
    Subtitle,
    LogoBox,
    Line,
} from '../styled/HeroStyles';
import backgroundImage from '../img/DaonBg.jpg';

export default function Hero() {
    return (
        <Container>
            <BackgroundImage src={backgroundImage} alt="Background" />
            <Overlay />
            <TextContainer>
                <LogoBox>
                    <Line />
                    <Title>고객의 혁신적 가치와</Title>
                    <Subtitle>사람을 중시하는 기업</Subtitle>
                </LogoBox>
            </TextContainer>
        </Container>
    );
}
